// Dependencies
import moment from 'moment';

// Styles
import { Box, Text, SimpleGrid, Flex } from '@chakra-ui/core';

const HistoryList = ({ id, history, createdAt }) => {
  console.log('HistoryList History');
  console.log(history);

  return (
    <Box
      alignSelf="center"
      border="1px solid black"
      borderRadius="1rem"
      width="100%"
      padding="1rem"
    >
      <Flex justify="space-between">
        <Text fontSize="2xl">Order No. {id}</Text>
        <Text fontSize="2xl">{moment(createdAt, 'YYYYMMDD').fromNow()}</Text>
      </Flex>
    </Box>
  );
};

export default HistoryList;
